  [],\n\t\"revision_timestamp\": \"2016-02-22T21:23:13.918310\",\n\t\"name\": \"nf-12-01-usvi-characterization-of-seafloor-habitats-of-the-u-s-caribbean\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The objective of this project is to collect
  a multibeam bathymetry dataset with 100% seafloor ensonification, along with multibeam
  backscatter suitable for seafloor characterization. Fishery acoustics data will
  be collected to characterize broad-scale fish abundance, biomass, and utilization
  patterns, as well as to locate and document fish spawning aggregations. Multibeam
  data will be collected to conform to IHO Order 1 (<100m) and Order 2 (>100m) accuracy
  standards. The strategies developed for each survey area will take into account
  the minimum depths, general bathymetry, and time allotment. The delineation and
  identification of seafloor habitats will be assisted by the use of a moderate-depth
  Remotely Operated Vehicle (ROV) and drop camera. The vehicle has video and frame
  camera capability to depths of 300 meters and will be used to point sampling within
  areas mapped during this mission.\",\n\t\"license_title\": null,\n\t\"extras\":
